import React from 'react';
import WorkCard from './molecules/WorkCard.jsx';
import './App.css';

const workItems = [
  {
    url: 'https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6668455e9dad2d127071c260_Project_Hero.webp',
    title: 'Yarn',
    year: '2024',
    description: 'We were commissioned by Yarn to transform their digital-only AI storytelling app for children aged 3 to 6.'
  },
  {
    url: 'https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6668455e9dad2d127071c260_Project_Hero.webp',
    title: 'Another Project',
    year: '2023',
    description: 'Description for another project.'
  },
  {
    url: 'https://cdn.prod.website-files.com/5e84a4363e823276637cc45c/6668455e9dad2d127071c260_Project_Hero.webp',
    title: 'Yet Another Project',
    year: '2022',
    description: 'Description for yet another project.'
  }
];

function App() {
  return (
      <>
    <Routes>
      <Route path="/" exact element={<Matches />} />
      <Route path="/team/:id" exact element={<TeamDetail />} />
      <Route path="/player/:id" exact element={<PlayerDetail />} />
      <Route path="/league/:id" exact element={<Leagues />} />
      <Route path="/league-list/" exact element={<LeagueList />} />
      <Route path="/match-details/:id" exact element={<MatchDetail />} />
    </Routes>
      </>
  )
}

export default App;
